import React, { Component } from "react";
import "../App.css";
export default class Footer extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const { companyName, copyRight } = this.props;
    return (
      <div className="foot-cont">
        <p className="text-foot red">Powered By {companyName} | </p>
        <p className="text-foot gray">Contact me : {copyRight}</p>
      </div>
    );
  }
}
